    false,nt"url": null,nt"notes": "This document contains both a public hearing
    summary analysis and a wilderness study summary for the Charles M. Russell National
    Wildlife Range. The public hearing analysis discusses five separate hearings and
    the overall conclusion of majority opposition to wilderness designation. The wilderness
    study summary gives information on the proposed area's history, location, public
    use of the land, current and future management, and concludes that some areas of
    the Charles M. Russell National Wildlife Range are suitable for wilderness designation.",nt"license_title":
